<!<!doctype html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">

    <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/3.3.6/css/bootstrap.min.css"
          integrity="sha384-1q8mTJOASx8j1Au+a5WDVnPi2lkFfwwEAa8hDDdjZlpLegxhjVME1fgjWPGmkzs7" crossorigin="anonymous">

    <link rel="stylesheet" type="text/css" href="css/style.css"/>


    <title>login</title>
</head>
<body>

<div class="titlle">
    <h1>Faça login
        para entrar para o nosso time <span class="badge badge-secondary">New</span></h1>
</div>

<div class="container titleLogin">
    <div class="row titleDiv">
        <div class="col-4 textlogin">
            <h1>Login</h1>
        </div>
        <div class="col-4">
            <form method="post">
                <div class="mb-3">
                    <label for="exampleInputEmail1" class="form-label acessos">Usuário</label>
                    <input type="text" class="form-control backgrounAcessos" name="login" id="exampleInputEmail1"
                           aria-describedby="emailHelp" placeholder="Usuário">
                    <div id="emailHelp" class="form-text">Não salvamos as informacoes.</div>
                </div>

                <div class="mb-3">
                    <label for="exampleInputPassword1" class="form-label acessos">Senha</label>
                    <input type="password" class="form-control backgrounAcessos" name="pass" id="exampleInputPassword1"
                           placeholder="Senha">
                </div>

                <div class="mb-3 form-check">
                    <input type="checkbox" class="form-check-input" id="exampleCheck1">
                    <label class="form-check-label" for="exampleCheck1">Visualizar senha</label>
                </div>

                <div class="buttonLogin">
                    <button type="submit" name="sub" class="btn btn-primary login">Login</button>
                </div>

            </form>
        </div>
        <div class="col-4">
        </div>
    </div>
</div>

<div class="row">
    <div class="cow-4">
        <div class="imglogin">
            <svg viewBox="0 0 625 595" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                <rect width="625" height="595" rx="297.5" transform="matrix(-1 0 0 1 625 0)" fill="url(#pattern0)"/>
                <defs>
                    <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                        <use xlink:href="#image0_125_181" transform="matrix(0.000976562 0 0 0.0010258 0 -0.0252101)"/>
                    </pattern>
                    <image id="image0_125_181" width="1024" height="1024" xlink:href="data:image/jpeg;base64,"/>
                </defs>
            </svg>
        </div>
    </div>
    <div class="cow-4"></div>
    <div class="cow-4"></div>
</div>

<div class="container footer">
    <div class="row">
        <div class="col-4">
            <footer>
                <p class="copy">&copy; 2023 / Fenxus-Xampson-Lubrix-LTDA</p>
            </footer>
        </div>
        <div class="col-4"></div>
        <div class="col-4"></div>
    </div>
</div>


<script src="https://maxcdn.bootstrapcdn.com/bootstrap/3.3.6/js/bootstrap.min.js"
